import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import API from '../api';

export default function CourseDetail() {
  const { id } = useParams();
  const [course, setCourse] = useState(null);
  const [lessons, setLessons] = useState([]);
  const [selected, setSelected] = useState(null);
  const [progress, setProgress] = useState([]);

  useEffect(() => { fetchCourse(); fetchLessons(); fetchProgress(); }, [id]);

  async function fetchCourse() { try { const res = await API.get(`/courses/${id}`); setCourse(res.data); } catch (e) { console.error(e); } }
  async function fetchLessons() { try { const res = await API.get(`/lessons/${id}`); setLessons(res.data); if (res.data[0]) setSelected(res.data[0]); } catch (e) { console.error(e); } }
  async function fetchProgress() { try { const res = await API.get(`/progress/course/${id}`); setProgress(res.data); } catch (e) { console.error(e); } }

  async function markDone(lessonId) {
    try { await API.post(`/progress/lesson/${lessonId}/complete`); fetchProgress(); alert('Marked complete'); } catch (e) { console.error(e); alert('Error'); }
  }

  function isUnlocked(l) {
    if (!l.release_date) return true;
    return new Date(l.release_date) <= new Date();
  }

  return (
    <div style={{ display: 'flex', gap: 20, padding: 20 }}>
      <div style={{ width: 320 }}>
        <h2>{course?.title}</h2>
        <p>{course?.description}</p>
        <h3>Lessons</h3>
        <ul style={{ listStyle: 'none', padding: 0 }}>
          {lessons.map(l => (
            <li key={l.id} style={{ padding: 8, cursor: 'pointer', background: selected?.id === l.id ? '#eee' : 'transparent', marginBottom: 6 }}>
              <div onClick={() => isUnlocked(l) ? setSelected(l) : null}>
                {l.position}. {l.title} {!isUnlocked(l) && <span style={{ color: '#999' }}> (Locked until {new Date(l.release_date).toLocaleString()})</span>}
                {progress.includes(l.id) && <span style={{ color: 'green', marginLeft: 8 }}>âœ“</span>}
              </div>
            </li>
          ))}
        </ul>
      </div>

      <div style={{ flex: 1 }}>
        {selected ? (
          <>
            <h3>{selected.title}</h3>
            {selected.content_type === 'video' && (
              <video width="100%" height="480" controls>
                <source src={selected.content_url.startsWith('http') ? selected.content_url : `http://localhost:5001${selected.content_url}`} type="video/mp4" />
                Your browser does not support video.
              </video>
            )}
            {selected.content_type === 'pdf' && (
              <iframe src={selected.content_url.startsWith('http') ? selected.content_url : `http://localhost:5001${selected.content_url}`} width="100%" height="600" title={selected.title} />
            )}
            {selected.content_type === 'text' && (
              <div dangerouslySetInnerHTML={{ __html: selected.content_url }} />
            )}
            <div style={{ marginTop: 12 }}>
              <button onClick={() => markDone(selected.id)}>Mark Completed</button>
            </div>
          </>
        ) : <p>Select a lesson</p>}
      </div>
    </div>
  );
}
